import React from 'react';

function CreateTeamMain(props) {
    return (
        <div className='container-fluid'>
            <div className='container d-flex justify-content-start align-items-start flex-column gap-4'>
                <h1>Create Team</h1>
                <form className='w-100 d-flex justify-content-start align-items-start gap-3 flex-wrap'>
                    <input type='text' id='team_name' placeholder='Team Name'/>
                    <input type='datetime-local'/>
                    <button>
                        <i className='fa fa-plus'></i>
                    </button>
                </form>
            </div>
        </div>
    );
}

export default CreateTeamMain;
